  b 22.08.1956 d 19.02.1998
  Benjamin b. at Hastings and m, at Feilding. Kirsty, d/o Dr Ross Jones and
  Barbara Jones, b. at Feilding. Address: "Tuapai", RD 1, Hastings.
  Ben was educated at Hereworth and Wanganui Collegiate Schools. He went
  shepherding at "Tangihau" station, Gisborne and on cattle stations in
  Central Northern Australia. He is now farming at "Tuapae" in the Kereru
  district, Hastings.
  Kirsty was a nurse.
